async function getStockJSON(ticker: string): Promise<any> {
    console.log(`fetching ${ticker} JSON `);
    fetch(`https://sandbox.iexapis.com/stable/stock/${ticker}/quote/
    ?token=Tpk_dec7b122df1e4bce8e1ebe0e6632fc06`, {
    })
    .then(response => {
        const data = response.json()
        return data
    })
    .then(data => {
        console.log(`JSON for ${ticker} is ${data}`)
        return data
    })
    .catch((error) => {
        return `Tried to fetch ${ticker}, but the stock wasn't found ):`;
    });
}

export default getStockJSON;
